function ordenacaoHorarios(a, b) {
  //return a.hora < b.hora;
  if (a.hora < b.hora) {
    return -1;
  } else if (a.hora > b.hora) {
    return 1;
  } else if(a.descricao < b.descricao) {
    return -1;
  } else if (a.descricao > b.descricao) {
    return 1;
  } else {
    return 0;
  }
}

function atualizaTabelaHorarios(novaTabela) {
  tabelaHorarios = novaTabela;
  
  $(tabelaHorarios).each(function() {
    this.hora = formatTime(this.hora);
  });

  tabelaHorarios.sort(ordenacaoHorarios);
  
  localStorage.setItem('tabelaHorarios', JSON.stringify(tabelaHorarios));
}

